"""### Example 04: Factorial calculation"""

def fact(n):
    result = 1
    while n > 0:
        result *= n
        n -= 1
    return result

print(fact(4))

def fact(n):
    if n==0 or n==1:
        return 1
    else:
        return n*fact(n-1)

print( fact(4) )

"""### Example 05: Fibonachi series summation"""

def get_nth_fibonacci(n):
    if n == 0:
        return 0
    elif n == 1:
        return 1
    elif n > 1:
        n1 = 0
        n2 = 1

        for _ in range(2, n + 1):
            fib_sum = n1 + n2
            n1 = n2
            n2 = fib_sum

        return n2
    else:
        return -1

# Example usage
n = 4
print(f"{n}th Fibonacci number is: {get_nth_fibonacci(n)}")

n = 6
print(f"{n}th Fibonacci number is: {get_nth_fibonacci(n)}")

n = 8
print(f"{n}th Fibonacci number is: {get_nth_fibonacci(n)}")

def get_nth_fibonacci_recursive(n):

    if n == 0:
        return 0
    elif n == 1:
        return 1
    elif n>1:
        return get_nth_fibonacci_recursive(n - 1) + get_nth_fibonacci_recursive(n - 2)

n = 4
print(f"{n}th Fibonacci numbers is: {get_nth_fibonacci_recursive(n)}")

n = 6
print(f"{n}th Fibonacci numbers is: {get_nth_fibonacci_recursive(n)}")

n = 8
print(f"{n}th Fibonacci numbers is: {get_nth_fibonacci_recursive(n)}")

