import numpy as np
## USING RECURSION
def arrSum(arr):
    # When array has only 1 element return that
    if len(arr)==1: # Base case
        return arr[0]
    else:
        return arr[0] + arrSum(arr[1:]) # Recursive call # removing the 1st element before each recursive calls

arr1D = np.array([7, 2, 5, 0, 3])
sum = arrSum(arr1D)
print(sum)

## USING RECURSION
def arrSum(i, arr):
    # The base case is triggered when i reaches the last index of the array (len(arr) - 1).
    if i==len(arr)-1: # Base case
        return arr[i]
    else:
        return arr[i] + arrSum(i+1, arr) # Recursive call # increasing i by 1

arr1D = np.array([1,4,6,5,9,3])
sum = arrSum(0, arr1D)
print(sum)

