"""### Example 15: Finding minimum value from a LL"""

class Node:
    def __init__(self, elem, next=None):
        self.elem = elem
        self.next = next

def find_minimum(head):
    if head is None:
        return None  # Handle the case of an empty list

    # Initialize the minimum value with the data of the head node
    min_value = head.elem# i = 0
    current = head.next  # Start traversing from the second node i= 1

    while current is not None:
        if current.elem < min_value:  # Update min_value if a smaller value is found
            min_value = current.elem
        current = current.next  # Move to the next node i = i +1

    return min_value


head = arr2LL([10, 20, 5, 15])
printLL(head)

# Find the minimum value in the linked list
minimum = find_minimum(head)
print(f"The minimum value in the linked list is: {minimum}")

def find_min_recursive(temp):
    # Base case: if there's only one node, return its value
    if temp.next is None:
        return temp.elem

    # Recursive case: find the minimum in the rest of the list
    min_val = temp.elem
    min_node_rest_val = find_min_recursive(temp.next)
    # Compare the current node's value (temp.elem) with the minimum value of the rest
    if min_node_rest_val < temp.elem:
        min_val = min_node_rest_val

    return min_val


head = arr2LL([10, 20, 5, 15])
